class MyRouter {
    static Home = "/"
    static Products = { href: "/products" }
    static ProductDetail = {
        href: `${this.Products}/[slug]`,
        slug: (slug) => {
            console.log(`${this.Products}/${slug}`)
            return `${this.Products}/${slug}`
        }
    }
}
export default MyRouter
